import React, { useEffect, useState } from 'react';
import { Link } from "react-router-dom";
import InfoErrorApi from '../Utils/InfoErrorApi';
import GenericApi from '../Api/Services/GenericApi';
import 'moment/locale/es';
import Spinner from '../Utils/Spinner';
import DataTable from 'react-data-table-component';
import ListaBotones from '../Utils/ListaBotones';
import '../Utils/Constants';

function ParametroCamposLista() {

    const [parametroCamposLista, setParametroCamposLista] = useState({ data: [] });
    const [getSeach, setSeach] = useState('');
    const paganationPerPages = global.Constants.DATA_TABLE.PAGINATION_PER_PAGE;
    const [perPage, setPerPage] = useState(global.Constants.DATA_TABLE.PAGINATION_PER_PAGE);
    const [pageActual, setPageActual] = useState(1);
    const [getEstadoLista, setEstadoLista] = useState('1');

    const [getRoutes, setRoutes] = useState({
        crear_registro: "/ParametroCampos/Add",
        consultar_registros: "/ParametroCampos",
        muestra_atras: false,
        id_etapa: global.Constants.ETAPAS.NINGUNA,
    });

    const handleCallback = (childData) => {
        try {

            setEstadoLista(childData)
        } catch (error) {

        }

    }

    const columns = [
        {
            name: 'Nombre parámetro',
            selector: p => p.attributes.nombre_campo,
            sortable: true,
            width: "35%"
        },
        {
            name: 'Tipo campo',
            selector: p => p.attributes.type == null ? "-" : p.attributes.type,
            sortable: true,
            width: "25%"
        },
        {
            name: 'Valor seleccionado',
            selector: p => p.attributes.value == null ? "-" : p.attributes.value,
            sortable: true,
        },
        {
            name: 'Estado',
            selector: p => (p.attributes.estado == "1" ? 'Activo' : 'Inactivo'),
            sortable: true,
        },
        {
            name: 'Acciones',
            cell: p =>
                <div>
                    <Link to={`${p.id}`}>
                        <button type="button" className="btn btn btn-primary" title='Editar'>
                            <i className="fa fa-fw fa-edit"></i>
                        </button>
                    </Link>
                </div>
        }
    ];

    useEffect(() => {
        async function fetchData() {
            window.showSpinner(true);
            cargarParametroCampos(1, paganationPerPages);
        }
        fetchData();
    }, []);

    const cargarParametroCampos = (page, perPage) => {
        GenericApi.getAllGeneric('parametro-campos').then(
            datos => {
                if (!datos.error) {
                    setParametroCamposLista(datos);
                    window.showSpinner(false);
                } else {
                    window.showModal();
                    window.showSpinner(false);
                }
            }
        )
    }

    const handlePageChange = page => {
        //window.showSpinner(true);
        setPageActual(page);
        //cargarCiudad(page, perPage);
    }

    const handlePerRowsChange = async (newPerPage, page) => {
        //window.showSpinner(true);
        setPerPage(newPerPage);
        setPageActual(page);
        //cargarCiudad(page, newPerPage);

    }

    return (
        <div className="block block-rounded block-bordered">
            {<InfoErrorApi />}
            {<Spinner />}
            <div className="block block-themed">
                <div className="col-md-12">
                    <div className="block-content">
                        <nav aria-label="breadcrumb">
                            <ol className="breadcrumb breadcrumb-alt push">
                                <li class="breadcrumb-item"> <small>Lista de Parametros por Campos </small></li>
                            </ol>
                        </nav>
                    </div>
                </div>
                <div className="block-header">
                    <h3 className="block-title">Parametro Campos registrados {getEstadoLista == global.Constants.ESTADOS.INACTIVO ? "Inactivas" : "Activas"}</h3>
                </div>
                <div className="block-content">
                    <div className='row'>
                        <div className='col-md-3'>
                            <div className="form-group ">
                                <input type="text" id="search" name="search" value={getSeach} onChange={e => setSeach(e.target.value)} onKeyPress={(e) => { e.key === 'Enter' && e.preventDefault(); }} className="form-control border border-success" placeholder="Buscar" />
                            </div>
                        </div>
                        <ListaBotones getRoutes={getRoutes} parentCallback={handleCallback} id="botonesNavegacion" name="botonesNavegacion" />
                    </div>
                    <div className="row">
                        <div className="col-sm-12">
                            <DataTable className="table table-bordered table-striped table-vcenter js-dataTable-full"
                                columns={columns}
                                data={parametroCamposLista.data.filter((suggestion) => {
                                    if (getSeach === "") {
                                        if (suggestion.attributes.estado == getEstadoLista) {
                                            return suggestion;
                                        }
                                    } else if (
                                        ((suggestion.id
                                            + suggestion.attributes.nombre_campo
                                            + suggestion.attributes.type
                                            + (suggestion.attributes.value)
                                            + (suggestion.attributes.estado == "1" ? 'Activo' : 'Inactivo')).toLowerCase().includes(getSeach.toLowerCase())
                                            && (suggestion.attributes.estado == getEstadoLista))
                                    ) {
                                        return suggestion;
                                    }
                                })}
                                perPage={perPage}
                                page={pageActual}
                                pagination
                                noDataComponent="Sin datos"
                                paginationTotalRows={parametroCamposLista.data.length}
                                onChangePage={handlePageChange}
                                onChangeRowsPerPage={handlePerRowsChange}
                                defaultSortFieldId="Nombre"
                                striped
                                paginationComponentOptions={{ rowsPerPageText: 'Filas por página' }}
                                defaultSortAsc={false}
                            />

                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default ParametroCamposLista;
